import React from "react";
import { GameOverContainer } from "./GameOverElements";

const GameOver = (show, winner) => {
    return (
        <GameOverContainer show={show}>
            <h2>Winner!</h2>
            <div>{"cec"}</div>
        </GameOverContainer>
    );
};

export default GameOver;
